import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import fire from "./Fire";
class App extends Component {
  state = {
    List: [
      { uid: "A", msg: "A" },
      { uid: "B", msg: "B" },
      { uid: "C", msg: "C" }
    ]
  };

  render() {
    return <div className="App" />;
  }
}

export default App;
